//component import 
import { Grid } from "@material-ui/core";
import React from "react";
import Banner from "./Banner"
import Categroies from "./Categories";
import Posts from "./Posts";

const Home = () => {
    return (
        <React.Fragment>
            <Banner />
            <Grid container>
                <Grid item lg={2} xs={12} sm={12}>
                <Categroies />
                </Grid>
                <Posts />
            </Grid>
        </React.Fragment>
    )
}

export default Home;
